import './Expenseitem.css';


const Expenseitem = (props) => {

 const month =props.thatDay.toLocaleString('en-US',{month:'long'});
 const year =props.thatDay.toLocaleString('en-US',{day:'l'});
 const day =props.thatDay.getFullYear();

  return ( 
    <div className="expense-item">
      <div className="Date">
        {/* {props.thatDay.toISOString()} */}
        <div>{month}</div>
        <div>{year}</div>
        <div>{day}</div>
        </div>
      <div className="expense-item__description">
        <h2>{props.title}</h2>
        <div className="expense-item__price">${props.rate}</div>
      </div>
    </div>
   );
}
export default Expenseitem;
